func TestDecode(t *testing.T) {
	qrPath := `/Users/liaoyong/workspace/dev/src/gitee.com/monkey0001/my_tools/lib/barcode/test.png`
	ptr, err := plugin.Open("/Users/liaoyong/workspace/dev/src/gitee.com/monkey0001/my_tools/lib/qr_decode/opencv.so")
	if err != nil {
		panic(err)
	}
	decodeFunc, err := ptr.Lookup("qrdecode")
	if err != nil {
		panic(err)
	}
	res := decodeFunc.(func(filename string) string)(qrPath)
	fmt.Println("结果:", res)
}

